// actions/datasetActions.js
export const updateDatasetList = (newList) => ({
    type: 'UPDATE_DATASET_LIST',
    payload: newList
});

export const updateDatasetMapList = (newMapList) => ({
    type: 'UPDATE_DATASET_MAP_LIST',
    payload: newMapList
});
